import React, {useState} from 'react'
import './App.css';

const Dish = ({ dish }) => {

  return (
    <div>
      {dish.name}
    </div>
  );

}

const App = () => {
  const [dish, setDish] = useState([
    {name: 'injera'},
    {name: 'Akara'},
    {name: 'Bandeja Paisa'},
    {name: 'Tandoori Chicken'}
  ])

  return (
    <div className="App">
      {console.log(dish)}
      <div>
        {/*eslint-disable-next-line array-callback-return*/}
        {dish.map((dish) => {
          return <Dish  dish={dish} />
        })}
      </div>
    </div>
  );
}

export default App;
